import React, { Component } from "react";
import AuthContext from "../../../../Hoc/Authcontext/auth-context";


const model = {
    apple: ['iPhone 5','iPhone 4', 'iPhone 6', 'iPhone 7', 'iPhone 8', 'iPhone x', 'iPhone 11', 'iPhone 12', 'iPhone 6'
                , 'iPhone 13'],
    samsung: ['j5', 'a5', 'j6', 'a6', 'a9', 'a10', 's9', 's10'],

    htc: ['model1', 'model2', 'model3', 'model4', 'model5']
}


class PhoneModel extends Component {    

    render () {

        const models = Object.keys(model).map(item => {
            if (item === this.props.model) {
                model.item.map(igKey => {
                    return <div>
                        <h2>{item}</h2>
                        <p>{igKey}</p>
                    </div>
                })
            }
        })

        return (
            {models}
        )
    }


}



export default PhoneModel;
